function CheckoutPage() {
    return ( 
        <div className=" w-screen h-11/12 flex flex-col py-16"
                style={{backgroundColor :'#e5e7eb'}}>
            <div className="bg-white rounded-lg h-14 w-full mx-9 w-full text-center font-semibold flex items-cente">
                    <p> My Shopping Cart</p>   
            </div>
        </div>
     );
}

export default CheckoutPage;
